column3:
Thank you Paper Magazine for this excellent interview with Vincent Martell, founder of VAM, director and co-writer of #DamagedGoods: 

&quot;I've never seen proper representation of myself as a gay, Black man. We were tired of waiting for people to figure it out, so we took matters into our own hands. The representation we have seen is plastic ‚Äî based off a white, Hollywood perspective and not authentic or relatable. Growing up without any proper characters on TV to look up to can be detrimental to someone's psyche, and we're just now seeing a shift in Hollywood where the people behind the lens are also in front of the lens. There's power in that, and artists around the world can connect with these experiences.&quot; 

#DamagedGoods premieres on OTV on April 4!
